<!DOCTYPE html>

<html lang="en"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"><script>
      if (document.location.pathname !== '/home' && document.location.pathname !== '/home2' && document.cookie && document.cookie.indexOf('authorization=') > -1) {
        var match = document.cookie.match(new RegExp('(^| )scope=([^;]+)'))
        var redirect = '/dashboard'
        if(match && match[2]){
          redirect = match[2]
        }
        window.location.href = redirect
      }
    </script></head></html>
